// SearchResult.js

import React from 'react';

const SearchResult = ({ searchResult }) => {
  return (
    <div>
      <ul>
        {searchResult &&
          searchResult.map((user) => (
            <li key={user.id}>
              <p>이메일 : {user.name}</p>
              <p>닉네임 : {user.address}</p>
            </li>
          ))}
      </ul>
    </div>
  );
};
